import Home from "../pages/home/Home";
import Login from "../pages/login/Login";

export const GuiRoutes = [
     {
        path: "/login",
        component: Login,
        title: "Login"
    },
    {
        path: "",
        component: Home,
        title: "Home"
      },
      {
        path: "*",
        component: Home,
        title: "Home"
      },
     
]
